import React from 'react';

const VendorPortal = () => {
  return (
    <div style={{ textAlign: 'center', padding: '2rem' }}>
      <h2>Vendor Portal</h2>
      <p>This is where your store dashboard will be.</p>
    </div>
  );
};

export default VendorPortal;
